import "./App.css";
import { useEffect } from "react";
import axios from "axios";

function App() {
  useEffect(() => {
    var axios = require("axios");

    var config = {
      method: "get",
      url: "",
      headers: {},
    };

    axios(config)
      .then(function (response) {
        console.log(JSON.stringify(response.data));
      })
      .catch(function (error) {
        console.log(error);
      });
  });

  return (
    <div className="App">
      <div>
        <div className="heading">RAILWAY SCHEDULER</div>
        <div className="content">
          <div className="row">
            <div className="column" style={{ width: "70%" }}>
              <h2>Train Name</h2>
              <p>Some text..</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
